    <section className="hero">
      <div className="hero-content">
        <h2>Hey! I'm Suma Sarakadam</h2>
        <p>A Frontend Developer passionate about building amazing digital experiences.</p>
        <button className="btn">Hire Me</button>
      </div>
      
    </section>
  );
};

export default Home;
